sentences:
  - 'Yogurt is a good source of conjugated linoleic acid (CLA), which has been shown to inhibit the growth and migration of breast cancer cells.'
  - Case-control studies conducted in France and Uruguay have found that yogurt consumption is associated with a reduction in the risk of breast cancer.
